import React from 'react';
import './App.css';
import Nav from './component/Nav/Nav';
import Logo from './component/Logo/Logo';


class App extends React.Component {
  render() {
      return (
          <div>
              <Nav />
              <Logo />
              <ImageLinkForm />
          </div>
        )
  }
}

export default App;

